import React from 'react';

interface TaskProps {
    todo: {
        text: string;
        complete: boolean;
    };
}

export const Task: React.FC<TaskProps> = ({ todo }) => {
    return (
        <li>
          <label>
            <input type="checkbox" checked={todo.complete}/>
                {todo.text}
          </label>
        </li>
    );
};
